function CardData(picture, title, description){
    this.picture = picture;
    this.title = title;
    this.description = description;
}

export var tmp = [];
tmp = [new CardData("ss", "ok", "iy"), new CardData("ss", "this is [79] title", "iy")];
tmp.push(new CardData("ss", "HEYHEYU", "ily"));
